import { Link } from "react-router-dom";
import logo from "../../img/logo-linkedin-icon-2048.png";

export default function NavBar() {
  return (
    <div>
      <div>
        <h1>Woof</h1>
        <Link to="https://www.linkedin.com/in/luis-felipe-moraes-319ab21a9/">
          <img id="logoLI" src={Logo} alt="a happy dog icon" />
        </Link>
      </div>
      <Link to="/">
        <button>Home</button>
      </Link>
      <Link to="/add">
        <button>Create a dog</button>
      </Link>
    </div>
  );
}
